  "Allegations" : "Without admitting or denying the findings, Venable consented to the sanctions and to the entry of findings that he effected discretionary transactions in accounts belonging to customers, all of whom were members of the same household, without obtaining prior written authorization from the customers, and without his member firm having accepted the accounts as discretionary. The findings stated that these customers had only given Venable express or implied authority to exercise discretion in their accounts. The findings also stated that Venable provided false responses on annual compliance questionnaires submitted to his member firm indicating that he had not exercised discretion in any customer account when, in fact, he had done so.",
